import React from "react";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Rent from "../../pages/Rent";
import Login from "../../pages/Login";

import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";

function Navbar() {
  const handleSelect = (eventKey) => alert(`selected ${eventKey}`);

  return (
    <Router>
      <div>
        <Nav bg="dark" variant="pills" activeKey="1" onSelect={handleSelect}>
          <Nav.Item>
            <Nav.Link as={Link} to={"/rent"}>
              Rent
            </Nav.Link>
          </Nav.Item>

          <NavDropdown title="Login" id="nav-dropdown">
            <NavDropdown.Item>
              <Nav.Link as={Link} to={"/login"}></Nav.Link>
              Renter
            </NavDropdown.Item>
            <NavDropdown.Item>Rental Agency</NavDropdown.Item>
          </NavDropdown>

          <NavDropdown title="Register" id="nav-dropdown">
            <NavDropdown.Item>Renter</NavDropdown.Item>
            <NavDropdown.Item>Rental Agency</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </div>
      <div>
        <Route path="/rent" component={Rent}></Route>
        <Route path="/login" component={Login}></Route>
      </div>
    </Router>
  );
}

export default Navbar;
